import MenuButton from '../ReusableComponents/MenuButton';

export default function Header()  {

    const [name] = useState(prompt("Bem-vindo à nossa página! Como te podemos chamar?"))



    return (
        <div class="m-0 w-screen">
        <h1 > Bem vindo à Food Wish, {name} </h1>
            <a class="cursor-pointer">
             <MenuButton />
            </a>
        </div>
    )
}
